import React, { useState, useEffect } from "react";
import axios from "axios";
import { jwtDecode } from "jwt-decode";

function AdminInventory() {
  const [medicines, setMedicines] = useState([]);
  const [newMedicine, setNewMedicine] = useState({ name: "", stock: 0 });
  const [editedMedicine, setEditedMedicine] = useState({});
  const [editMode, setEditMode] = useState(null);
  const [isAdmin, setIsAdmin] = useState(false);

  const fetchMedicines = () => {
    axios
      .get("http://localhost:5000/api/medicines/all")
      .then((res) => setMedicines(res.data))
      .catch((err) => console.error(err));
  };

  useEffect(() => {
    fetchMedicines();

    const token = localStorage.getItem("token");
    if (token) {
      try {
        const decoded = jwtDecode(token);
        if (decoded.email === "admin@gmail.com") {
          setIsAdmin(true);
        }
      } catch (err) {
        console.error("Invalid token", err);
      }
    }
  }, []);

  const handleAdd = () => {
    axios
      .post("http://localhost:5000/api/medicines/add", newMedicine)
      .then(() => {
        fetchMedicines();
        setNewMedicine({ name: "", stock: 0 });
      })
      .catch((err) => console.error(err));
  };

  const handleDelete = (id) => {
    axios
      .delete(`http://localhost:5000/api/medicines/delete/${id}`)
      .then(() => fetchMedicines())
      .catch((err) => console.error(err));
  };

  const startEdit = (med) => {
    setEditMode(med.id);
    setEditedMedicine({ name: med.name, stock: med.stock });
  };

  const cancelEdit = () => {
    setEditMode(null);
    setEditedMedicine({});
  };

  const handleUpdate = (id) => {
    axios
      .put(`http://localhost:5000/api/medicines/update/${id}`, editedMedicine)
      .then(() => {
        fetchMedicines();
        cancelEdit();
      })
      .catch((err) => console.error(err));
  };

  return (
    <div className="container">
      <h2>Pharmacy Inventory (Admin)</h2>

      {isAdmin ? (
        <>
          <h4>Add New Medicine</h4>
          <input
            type="text"
            placeholder="Medicine Name"
            value={newMedicine.name}
            onChange={(e) =>
              setNewMedicine({ ...newMedicine, name: e.target.value })
            }
          />
          <input
            type="number"
            placeholder="Stock"
            value={newMedicine.stock}
            onChange={(e) =>
              setNewMedicine({ ...newMedicine, stock: e.target.value })
            }
          />
          <button onClick={handleAdd}>Add Medicine</button>
        </>
      ) : (
        <p style={{ color: "red" }}>Access denied: Not an admin</p>
      )}

      <h4>Current Stock</h4>
      <ul>
        {medicines.map((med) => (
          <li key={med.id}>
            {editMode === med.id ? (
              <>
                <input
                  type="text"
                  value={editedMedicine.name}
                  onChange={(e) =>
                    setEditedMedicine({ ...editedMedicine, name: e.target.value })
                  }
                />
                <input
                  type="number"
                  value={editedMedicine.stock}
                  onChange={(e) =>
                    setEditedMedicine({ ...editedMedicine, stock: e.target.value })
                  }
                />
                <button onClick={() => handleUpdate(med.id)}>✅ Save</button>
                <button onClick={cancelEdit}>❌ Cancel</button>
              </>
            ) : (
              <>
                {med.name} ({med.stock}){" "}
                {isAdmin && (
                  <>
                    <button onClick={() => startEdit(med)}>✏️ Edit</button>{" "}
                    <button onClick={() => handleDelete(med.id)}>❌ Delete</button>
                  </>
                )}
              </>
            )}
          </li>
        ))}
      </ul>
    </div>
  );
}

export default AdminInventory;
